import React from 'react';

import { v4 as uuidv4 } from 'uuid';
import { data } from './../data';

export default function List({ leng, setActive }) {

    return (
        <ul className="list-container">
            {data[leng].projects.map(item =>
                <a
                    href={Object.keys(item)}
                    onClick={() => setActive(false)}
                    key={uuidv4()}
                >{Object.keys(item)}</a>)}
            <div className="social-nets">
                {data.social_nets.map(item =>
                console.log(item.instagram)

                    // <a href={item[1]} target="blank">
                    //     <i className={item[0]}></i></a>
                        )}
            </div>
        </ul>
    )
}
